script: |
  super -f text -I q12451.spq | sort > q12451.out

inputs:
  - name: q12451.spq
    data: |
      SELECT DISTINCT - col1 + - - col0 AS col1 FROM tab0 (FORMAT parquet) WHERE - 60 NOT IN ( + + 23 - col2 * + col2 * - - ( + - col2 ) + + 47 );
  - name: tab0

outputs:
  - name: q12451.out
    data: |
      -66
      66
      96
